window.bookSummaryJSON = "<p>Nestled in the Pennsylvania countryside, Florence University frames an idyllic college world, complete with cute coeds and handsome jocks - not to mention plenty of booze and sex with virtually no responsibility. For three seniors approaching graduation, the vagaries of life have rarely been so terrifying. </p> <p>Film buff Ian is at a loss as to what to do with the rest of his life - or what to do about the football player he has been fantasizing about. Haile is an accomplished classical musician, a veteran violinist who is taking a break from touring to finish her education, explore her dream of becoming a singer-songwriter, and escape her controlling mother. Casey is the handsome football star whose seemingly perfect existence masks an unsatisfactory love life and an inexplicable restlessness for something…more. </p> <p>Drawn together by their struggles for identity, the three students form a fateful friendship that will change the courses of their lives forever. Sexy, fast paced, and layered with intimate insight about life’s most formative years, <i>The Fall</i> is a compelling coming-of-age story about what happens when we are forced to confront who we are and who we want to become.</p>"; 
